import { Page } from "./Page";

export const CelsLidzIzvelei = () => {
  return (
    <Page>
      <div>
        {/* About us, bg image */}
        <div className="flex bg-center justify-center items-center bg-[url('assets/images/celsLidzIzvelei/decision.jpg')] md:h-about h-screen bg-cover bg-no-repeat">
          <h1 className="text-4xl text-white font-bold text-center font-montserrat">
            Ceļš līdz izvēlei
          </h1>
        </div>
      </div>
    </Page>
  );
};
